import React from "react";
// import PropTypes from 'prop-types'
import styled from "styled-components";
import Slideshow from "../components/Slideshow";
const H3 = styled.h3`
  font-size: 2em;
  margin: 0;
  padding: 0.5em 0;
`;

const Card = styled.div`
  background-color: rgba(0, 0, 0, 0.1);
  padding: 1em;
  border-radius: 20px;
  h4 {
    margin: 0;
    font-weight: 100;
    font-size: 2em;
  }

`;

const Home = (props) => {
  return (
    <div>
      <div className="containerX">
        <div className="row">
          <div className="col-xs-12 col-md-6" style={{ padding: "0.5em" }}>
            <H3>What is BUILDS?</H3>

            <Card>
              <Slideshow/>

              <h4>
                BUILDS: Boston University Information Lab and Design Space
              </h4>
              <p>
                BUILDS is an inclusive group of students, artists, hackers, and
                organizers who believe in the do-it-yourself attitude and hacker
                ethic.
              </p>
              <ul>
                <li>
                  Come join our community, hang out, and be in good company!
                  We’ll welcome you with open arms regardless of what you know
                  and who you are!
                </li>
                <li>
                  Meetings every Wednesday at 7:00 PM during the fall and spring
                  semesters, but e-mail us if you’re new to make sure!
                </li>
                <li>
                  BUILDS is located at{" "}
                  <a
                    href="https://goo.gl/maps/YDVvwSPXTG5MJu5n8"
                    target="_blank"
                    rel="noopener noreferrer"
                  >
                    111 Cummington Mall
                  </a>
                  , Room B26, Boston, MA, 02215 in Boston University.
                </li>
              </ul>
            </Card>
          </div>
          <div className="col-xs-12 col-md-6" style={{ background: "green" }}>
            this is a test
          </div>
          <div className="col-xs-12" style={{ background: "blue" }}>
            this is a test
          </div>
        </div>
      </div>
    </div>
  );
};

Home.propTypes = {};

export default Home;
